import HomePage from "../components/HomePage";

function Index({...props}) {

  useEffect(() => {
    return () => {
      document.title = `Home Page | ${pageTitle}`
    };
  })

  return (
    <main>
      <HomePage/>
    </main>
  );
}

export default Index;
